graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="count__key" align="left" balign="left">count : number</td><td port="count__value" align="left" balign="left">42</td></tr><tr><td port="price__key" align="left" balign="left">price</td><td port="price__value" align="left" balign="left">19.99</td></tr><tr><td port="scientific__key" align="left" balign="left">scientific</td><td port="scientific__value" align="left" balign="left">15000000000</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "temperature" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>temperature</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

}
